export const MenuListItem = (props) => {
    const [isHovered, setIsHover] = useState(false);

    function activate(){
        setIsHover(true)
    }
    function desactivate(){
        setIsHover(false)
    }

    return <div onMouseEnter={activate} onMouseLeave={des}>Set to : {props.difficulty}</div>

}
